function Footer() {
  return (
    <div className="bg-gray-900 flex w-full p-4 justify-between absolute bottom-0">
        <p className="font-sans text-gray-200 text-1xl">Made with ❤️ by Tarun Singh</p>
        <p className="font-sans text-gray-200 text-1xl">Copyright &copy; 
            <span className="hover:bg-gray-500 w-20 rounded p-1 ">Tarun</span>
        </p>
        <p className="font-sans text-gray-200 text-1xl">Thanks for visiting</p>
    </div>
  )
}

export default Footer
